class SetOperations:
    def __init__(self, lists):
        self.sets = [set(lst) for lst in lists]

    def calculate_operations(self):
        intersection_all = set.intersection(*self.sets)
        union_all = set.union(*self.sets)
        difference_all = self.sets[0].difference(*self.sets[1:])
        symmetric_difference_all = set(self.sets[0])  # Initialize with the first set
        for s in self.sets[0:]:
            symmetric_difference_all.symmetric_difference_update(s)

        return {
            "Intersection": list(intersection_all),
            "Union": list(union_all),
            "Difference": list(difference_all),
            "Symmetric Difference": list(symmetric_difference_all),
            "Len of Intersection": len(intersection_all),
            "Len of Union": len(union_all),
            "Len of Difference": len(difference_all),
            "Len of Symmetric Difference": len(symmetric_difference_all),
        }

